script: |
  super -f text -I q11400.spq | sort > q11400.out

inputs:
  - name: q11400.spq
    data: |
      SELECT - 39 + + COUNT ( * ) FROM tab2 (FORMAT parquet) WHERE NOT + + 96 + - 3 * ( - col0 ) IN ( + + 58 / col1 / col2 * + col2 );
  - name: tab2

outputs:
  - name: q11400.out
    data: |
      -36
